import './App.css';

import { useDispatch, useSelector } from 'react-redux';
import { addUser } from './redux/reduxSlices/counterSlice'

function App() {
	const count = useSelector((state) => state.counter.users)
	const dispatch = useDispatch()


	return (
		<div className="App">
			{count.map(m => <div>{m.id} {m.username} {m.fullName}</div>)}

			<button onClick={() => { dispatch(addUser({ id: 2, username: '@sundraBulka', fullName: 'Sundra Bulka' })) }}>click</button>
		</div>


	);
}



export default App;
